            <ion-icon
              id='selected'
              name="checkmark-circle"
              style={{
                position: 'absolute',
                top: '10px',
                right: '10px',
                color: plan.color,
                fontSize: '24px'
              }}
            ></ion-icon>
          )}
          <h2>{plan.name}</h2>
